function SponsorType(n){this.title=ko.observable(n.title)}function Sponsor(n){this.logo=ko.observable(n.logo);this.name=ko.observable(n.name);this.url=ko.observable(n.url);this.type=ko.observable(n.type)}function Speaker(n){this.photo=n.photo===undefined?"blank.png":ko.observable(n.photo);this.name=ko.observable(n.name);this.title=ko.observable(n.title);this.company=ko.observable(n.company);this.companyUrl=ko.observable(n.companyUrl);this.bio=ko.observable(n.bio);this.order=n.order===undefined?ko.observable("z"):ko.observable(n.order);this.orderKey=ko.observable(this.order()+n.name)}function Track(n){this.code=ko.observable(n.code);this.name=ko.observable(n.name);this.description=ko.observable(n.description)}function Session(n){this.hidden=n.hidden===undefined?ko.observable(!1):ko.observable(n.hidden);this.code=ko.observable(n.code);this.title=ko.observable(n.title);this.description=ko.observable(n.description);this.speakers=ko.observableArray(n.speakers);this.language=n.language===undefined?"Romanian":ko.observable(n.language);this.level=n.level===undefined||n.level===""?"-":ko.observable(n.level);this.langDisplay=function(){return this.language()==="English"?"(English)":""}}function TimeSlot(n){this.code=ko.observable(n.code);this.start=ko.observable(n.start);this.end=ko.observable(n.end);this.displayTracks=n.displayTracks===undefined?ko.observable(!1):ko.observable(n.displayTracks)}function Booking(n){this.timeSlot=ko.observable(n.timeSlot);this.track=ko.observable(n.track);this.session=ko.observable(n.session);this.alt=ko.observable(n.alt)}function Agenda(){var n=this;n.tracks=ko.observableArray();n.timeSlots=ko.observableArray();n.bookings=ko.observableArray();n.getTrack=function(t){var i=ko.utils.arrayFilter(n.tracks(),function(n){return n.code()===t});return i.length>0?i[0]:null};n.getTimeSlot=function(t){var i=ko.utils.arrayFilter(n.timeSlots(),function(n){return n.code()===t});return i.length>0?i[0]:null};n.getBookingsByTimeSlot=function(t,i){return ko.utils.arrayFilter(n.bookings(),function(n){return n.timeSlot().code()===t.code()&&(i===undefined||n.track()===i)})};n.isOneBookingForAllTracks=function(t){var i=n.getBookingsByTimeSlot(t,null);return i.length===1}}function Conference(n){var t=this;this.title=ko.observable(n);t.sponsorTypes=ko.observableArray();t.sponsors=ko.observableArray();t.speakers=ko.observableArray();t.sessions=ko.observableArray();t.agenda=new Agenda;t.getSpeaker=function(n){var i=ko.utils.arrayFilter(t.speakers(),function(t){return t.name()===n});return i.length>0?i[0]:null};t.getSession=function(n){var i=ko.utils.arrayFilter(t.sessions(),function(t){return t.code()===n});return i.length>0?i[0]:null};t.getSponsorsByType=function(n){return ko.utils.arrayFilter(t.sponsors(),function(t){return t.type()==n})}}